import React from "react";
import css from "./PaymentQR.module.css";

const PaymentQR = ({ onClose }) => {
  return (
    <div className={css.container} style={{}}>
      <h2>Payment QR Code</h2>
      <p>Scan to pay</p>
      <button onClick={onClose}>Close</button>
    </div>
  );
};

export default PaymentQR;
